skimr\")\n","library(\"gridExtra\")"]},{"cell_type":"markdown","id":"6951f926","metadata":{"papermill":{"duration":0.019524,"end_time":"2024-03-21T13:28:16.070604","exception":false,"start_time":"2024-03-21T13:28:16.05108","status":"completed"},"tags":[]},"source":["<a id=\"importing-datasets-and-assigning-new-names\"></a>\n","## 3.2 Importing Datasets and Assigning New Names\n","Before importing the datasets, it is important to verify if they are in the current working directory. If not, the `setwd()` function will be utilised to change this. Following that, the datasets will be imported, and new names will be assigned to facilitate identification."]},{"cell_type":"code","execution_count":2,"id":"3cec5f62","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2024-03-21T13:28:16.150773Z","iopub.status.busy":"2024-03-21T13:28:16.111048Z","iopub.status.idle":"2024-03-21T13:28:26.834079Z","shell.execute_reply":"2024-03-21T13:28:26.832074Z"},"papermill":{"duration":10.747976,"end_time":"2024-03-21T13:28:26.837732","exception":false,"start_time":"2024-03-21T13:28:16.089756","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m940\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m15\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (1): ActivityDate\n","\u001b[32mdbl\u001b[39m (14): Id, TotalSteps, TotalDistance, TrackerDistance, LoggedActivitiesDi...\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n","\u001b[1mRows: \u001b[22m\u001b[34m940\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m3\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u