QIwpCAAAA\nAAAAiBEFIQAAAAAAAMSIghAAAAAAAABiREEIAAAAAAAAMaIgBAAAAAAAgBhREAIAAAAAAECM\nKAgBAAAAAAAgRhSEAAAAAAAAECMKQgAAAAAAAIgRBSEAAAAAAADEiIIQAAAAAAAAYkRBCAAA\nAAAAADGiIAQAAAAAAIAYURACAAAAAABAjCgIAQAAAAAAIEYUhAAAAAAAABAjCkIAAAAAAACI\nEQUhAAAAAAAAxIiCEAAAAAAAAGJEQQgAAAAAAAAxoiAEAAAAAACAGFEQAgAAAAAAQIwoCAEA\nAAAAACBGFIQAAAAAAAAQIwpCAAAAAAAAiBEFIQAAAAAAAMSIghAAAAAAAABiREEIAAAAAAAA\nMaIgBAAAAAAAgBhREAIAAAAAAECMKAgBAAAAAAAgRhSEAAAAAAAAECMKQgAAAAAAAIgRBSEA\nAAAAAADEiIIQAAAAAAAAYkRBCAAAAAAAADGiIAQAAAAAAIAYURACAAAAAABAjCgIAQAAAAAA\nIEYUhAAAAAAAABAjCkIAAAAAAACIEQUhAAAAAAAAxIiCEAAAAAAAAGJEQQgAAAAAAAAxoiAE\nAAAAAACAGFEQAgAAAAAAQIwoCAEAAAAAACBGFIQAAAAAAAAQIwpCAAAAAAAAiBEFIQAAAAAA\nAMSIghAAAAAAAABiREEIAAAAAAAAMaIgBAAAAAAAgBhREAIAAAAAAECMKAgBAAAAAAAgRhSE\nAAAAAAAAECMKQgAAAAAAAIgRBSEAAAAAAADEiIIQAAAAAAAAYkRBCAAAAAAAADGiIAQAAAAA\nAIAYURACAAAAAABAjCgIAQAAAAAAIEYUhAAAAAAAABAjCkIAAAAAAACIEQUhAAAAAAAAxIiC\nEAAAAAAAAGJEQQgAAAAAAAAxoiAEAAAAAACAGFEQAgAAAAAAQIwoCAEAAAAAACBGFIQAAAAA\nAAAQIwpCAAAAAAAAiBEFIQAAAAAAAMSIghAAAAAAAABiREEIAAAAAAAAMaIgBAAAAAAAgBhR\nEAIAAAAAAECMKAgBAAAAAAAgRhSEAAAAAAAAECMKQgAAAAAAAIiR/9+eHQgAAAAACPK3HuTS\nSBACAAAAAADAiCAEAAAAAACAEUEIAAAAAAAAI4IQAAAAAAAARgQhAAAAAAAAjAhCAAAAAAAA\nGBGEAAAAAAAAMCIIAQAAAAAAYCTwzoHNpCRBuwAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":600,"width":1200}},"output_type":"display_data"}],"source":["# Percentage of Activity Levels\n","activity_level_total <- daily_activity_merged %>%\n","  summarise(\n","    sedentary_minutes_total = sum(daily_activity_merged$sedentary_minutes, na.rm = TRUE),\n","    fairly_active_minutes_total = sum(daily_activity_merged$fairly_active_minutes, na.rm = TRUE),\n","    lightly_active_minutes_total = sum(daily_activity_merged$lightly_active_minutes, na.rm = TRUE),\n","    very_active_minutes_total = sum(daily_activity_merged$very_active_minutes, na.rm = TRUE))\n","\n","activity_level <- c(activity_level_total$sedentary_minutes_total, activity_level_total$lightly_active_minutes_total, activity_level_total$fairly_active_minutes_total, activity_level_total$very_active_minutes_total)\n","labels <- c(\"Sedentary\", \"Lightly Active\", \"Fairly Active\", \"Very Active\")\n","colours <- c(\"#cebdbf\", \"#e3d4cb\", \"#996855\", \"#e7a589\")\n","percentage <- (activity_level/sum(activity_level)*100) %>% \n","  round(2)\n","labels <- paste(labels, percentage)\n","options(repr.plot.width = 20, repr.plot.height = 10)\n","pie(activity_level, labels=paste(labels, sep=\" \", \"%\"), col = colours, border = \"white\", radius = 1, cex = 1.5)\n","title(main=\"Percentage of Activity Levels\", cex.main = 2, line = -0.10)"]},{"cell_type":"markdown","id":"3e7abae8","metadata":{"papermill":{"duration":0.048901,"end_time":"2024-03-21T13:33:48.450814","exception":false,"start_time":"2024-03-21T13:33:48.401913","status":"completed"},"tags":[]},"source":["#### Key Findings\n","* A significant majority, **78.64%** of participants, maintained a **sedentary** lifestyle throughout the study period. This raises concerns, as prolonged physical inactivity often leads to various [health and medical conditions](https://www.ncbi.nlm.nih.gov/pmc/articles/PMC8068220/), including cardiovascular disease, diabetes, and certain cancers.\n","* Only **3.25%** of participants were **fairly** (1.27%) and **very** (1.98%) **physically active** over the 31-day period. This low figure suggests that a minority of users utilised the Fitbit device primarily for tracking exercise, while the majority likely focused on monitoring daily habits.\n","* It is possible that many participants are office employees or hold occupations involving predominantly sedentary activities. As per [Church et al.](https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3102055/), **over 80% of occupations in the US involve prolonged sitting or require light physical intensity**. \n","<br>\n","<br>\n","\n","#### **Correlation between Activity Levels and Calories Burnt per Day**\n","To explore potential correlations between activity levels and daily caloric expenditure, a visualisation will be created using ggplot2."]},{"cell_type":"code","execution_count":43,"id":"e4e98660","metadata":{"execution":{"iopub.execute_input":"2024-03-21T13:33:48.54801Z","iopub.status.busy":"2024-03-21T13:33:48.546333Z","iopub.status.idle":"2024-03-21T13:33:51.601068Z","shell.execute_reply":"2024-03-21T13:33:51.598814Z"},"papermill":{"duration":3.112872,"end_time":"2024-03-21T13:33:51.610423","exception":false,"start_time":"2024-03-21T13:33:48.497551","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n","\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n","\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n","\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AkZf348c+U7ZtsenK9U45yHkc5EKTjnUgHEZUOoiIKivhF+SIiflHABoIN\nFREU+MkXEEH4CkhvgpzUo90dXMulbpLN9p3n98fe7e0lu5tNstnZ3L5ffyXPtM88M/M8M/PZ\nmdGUUgIAAAAAAAAAAACgOuh2BwAAAAAAAAAAAACgfEgQAgAAAAAAAAAAAFWEBCEAAAAAAAAA\nAABQRUgQAgAAAAAAAAAAAFWEBCEAAAAAAAAAAABQRUgQAgAAYFJa/+I9F5x27M6zptZ4HN6a\n+p2WHPiVq369MW7ZFc8jy2dpmvbcQHxsk/9tcaumaWtiqdJGlW1Jjatm2gUTN/9J4ZXv7KFp\nmqZpX17RNf65Fb/VSr59NzyxXNO03S56sVQzHK1x7vAT5Jkzd9I07cHe6Ihjjr8BKUkNTPSB\nv/bhI7Rt6brhr2vZ+7BTfv/EhxO00IoV3vTbobVhOJumzDzkhHNufWK13dEBAAAA5UaCEAAA\nAJPPXZcdPWPpCTfe9tdwYMZ+hxy2+7y2jtefueG/z9th3uHPB2N2Rzey/g8uq6+v/8Sf37c7\nkNGZpGFn+++fr0z/ce/XHh3ttCVc/e2gJie1yd6AjFZgh4OO3eKoI5ftOl3/16N3nH3w/G8/\nvH6iF12Bu7rTvyhTG59cdtDs2tg///e3Zxw878j/vtfu0AAAAICyMu0OAAAAABid/9x04snf\nvz8w/5jb/vc3n9ytOV2YDK+/8etHX/jLx4465IrOf19tb4QjUlY0GAyGsh5XOvjeZ1dGk9Od\nho1RjWh42JPLwLqfPtATqVtwieeDH7U/c2FH4qQWxyh+MTmerTZkzMlek5NaRTUg5TnwZx9/\n3T1XL8kueelPX97rszf++JSzvt/z8IQuugJ3dV/beffc88XsktVP3nri0Z9/8KrjPr/Xml8f\nPcuuwAAAAIAy4wlCAAAATCaJ0L8PufAep/8jz6z4S+bmvoiY3mlfvem5M6f4u175wc/WhcY2\n83B3jrcF5iwsOd+seTvuuKOpjWVaK1ZJd9/LaL