+wAAekP2AfGLTxACCa5369Rt7vQLrn/wpbkXaF0LACBGvf/wtLue+e/GLb+7kzL7Dzpj\n0pwFI49t1fK7JYMAAHpD9gEA9IbsA+IXDUIAAAAAAAAAAABARwxaFwAAAAAAAAAAAAAgemgQ\nAgAAAAAAAAAAADpCgxAAAAAAAAAAAADQERqEAAAAAAAAAAAAgI7QIAQAAAAAAAAAAAB0hAYh\nAAAAAAAAAAAAoCM0CAEAAAAAAAAAAAAdoUEIAAAAAAAAAAAA6AgNQgAAAAAAAAAAAEBH/h/7\nlR9gAlYlJwAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":600,"width":1200}},"output_type":"display_data"}],"source":["# Correlation between Activity Level and Calories Burnt\n","p1 <- ggplot(data = daily_activity_merged, aes(x = sedentary_minutes, y = calories)) + geom_point(color = \"#cebdbf\") + geom_smooth(method = \"lm\", color = \"#996855\", fill = \"#e7a589\") + xlab(\"Sedentary Minutes\") + ylab(\"Calories Burnt\")\n","p2 <- ggplot(data = daily_activity_merged, aes(x = lightly_active_minutes, y = calories)) + geom_point(color = \"#cebdbf\") + geom_smooth(method = \"lm\", color = \"#996855\", fill = \"#e7a589\") + xlab(\"Lightly Active Minutes\") + ylab(\"Calories Burnt\")\n","p3 <- ggplot(data = daily_activity_merged, aes(x = fairly_active_minutes, y = calories)) + geom_point(color = \"#cebdbf\") + geom_smooth(method = \"lm\", color = \"#996855\", fill = \"#e7a589\") + xlab(\"Fairly Active Minutes\") + ylab(\"Calories Burnt\")\n","p4 <- ggplot(data = daily_activity_merged, aes(x = very_active_minutes, y = calories)) + geom_point(color = \"#cebdbf\") + geom_smooth(method = \"lm\", color = \"#996855\", fill = \"#e7a589\") + xlab(\"Very Active Minutes\") + ylab(\"Calories Burnt\")\n","\n","options(repr.plot.width = 20, repr.plot.height = 10)\n","grid.arrange(p1, p2, p3, p4,\n","             nrow = 1,\n","             top = \"Correlation between Activity Levels and Calories Burnt per Day\"\n",") "]},{"cell_type":"markdown","id":"315d318b","metadata":{"papermill":{"duration":0.055668,"end_time":"2024-03-21T13:33:51.722383","exception":false,"start_time":"2024-03-21T13:33:51.666715","status":"completed"},"tags":[]},"source":["#### Key Findings\n","* **The less active a person is, the fewer calories they will burn**.\n","* The more active a person is, the more calories they will burn. \n","* The **correlation coefficient between Very Active Minutes and Burnt Calories** is **0.61**,  indicating a **moderate level of correlation**. Additionally, with a p-value close to 0, this correlation is highly statistically significant.\n","* Despite fairly active and very active levels representing the smallest categories, individuals in these activity levels burn more calories compared to those in sedentary and lightly active levels.\n","<br>\n","<br>\n","\n","#### **Average Hourly Physical Intensity Throughout the Day**\n","To discern peak times of physical intensity throughout the day, a bar chart will be generated."]},{"cell_type":"code","execution_count":44,"id":"dd7fd5a3","metadata":{"execution":{"iopub.execute_input":"2024-03-21T13:33:51.836779Z","iopub.status.busy":"2024-03-21T13:33:51.835153Z","iopub.status.idle":"2024-03-21T13:33:52.41924Z","shell.execute_reply":"2024-03-21T13:33:52.416021Z"},"papermill":{"duration":0.645186,"end_time":"2024-03-21T13:33:52.42227","exception":false,"start_time":"2024-03-21T13:33:51.777084","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ4AkRdkA4J6w+cJeIFxCwh0ZJIePJDkImE9UJBhRFJUkSkaCIFERQaIJAQMC\nKklAgiA5COJxEkQOuOPybU7z/Rhcdntnw+1Nuq3n+bVbU9PzVk1NdU+9092JTCYTAQAAAAAA\nAGFIljoAAAAAAAAAoHgkCAEAAAAAACAgEoQAAAAAAAAQEAlCAAAAAAAACIgEIQAAAAAAAARE\nghAAAAAAAAACIkEIAAAAAAAAAZEgBAAAAAAAgIBIEAIQoub5v03kcs3cplKHRqG0LPpz33f8\n6iG843/YaJXYsyasd20RAi6JprlXxxo7fsZPShLJO88eGIskVTG+JJGEo3ze/cIJoY0lp5ML\nauXt3lPeNzbnoVdPyXRFbd3o1aetveX2ux96xNFX/ubuea2dpQ4cAABGLAlCAEL0z4vOzFl+\n0bnPFzkSAACiKMp0djQ3Ncx949Wn/n7vz6+46Esz95o6Ye3Pn37dwo5MqUMDAIARKF3qAACg\nBE6+/KWc5f++7uTMhXcmihwNUB7al70zb2lbz5LqiZMmVPlFXS/l2UvlGRUjW35HnTGcU3vj\n69ecdvjNv7nt9gev33ZcVanDAQCAESX07xsABGjZfy++fWFzzodaFt11yRvLihwPUCZeuHCf\nqb196q9zSh1U2SnPXirPqBj