\n","  guides(fill = guide_legend(title=\"Average Hourly Intensity\"))\n","options(repr.plot.width = 20, repr.plot.height = 12)"]},{"cell_type":"markdown","id":"47b121bd","metadata":{"papermill":{"duration":0.056143,"end_time":"2024-03-21T13:33:52.535632","exception":false,"start_time":"2024-03-21T13:33:52.479489","status":"completed"},"tags":[]},"source":["#### Key Findings\n","* The **lowest physical intensities** occur from **23:00 to 5:00**, corresponding to typical sleeping hour.\n","* **Peak intensity** is observed from **17:00 to 19:00**, coinciding with the time when people usually return home from work.\n","* Another **peak in intensity** is observed from **12:00 to 14:00**, indicative of lunch breaks.\n","<br>\n","<br>\n","\n","#### **Average Physical Intensity Throughout the Week**\n","To determine the most active day of the week, a weekly bar chart was generated."]},{"cell_type":"code","execution_count":45,"id":"e7d0b753","metadata":{"execution":{"iopub.execute_input":"2024-03-21T13:33:52.651051Z","iopub.status.busy":"2024-03-21T13:33:52.649501Z","iopub.status.idle":"2024-03-21T13:33:53.254969Z","shell.execute_reply":"2024-03-21T13:33:53.253189Z"},"papermill":{"duration":0.666597,"end_time":"2024-03-21T13:33:53.257912","exception":false,"start_time":"2024-03-21T13:33:52.591315","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAWgCAIAAABVZ+/5AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd4AU5f0/8Nnbq9wBdxQRECRYEBt+sWvsGmOMMZaosRBj7NFooj8Lxm40MSbW\nWBNLjInta43fxGgsqInRmCg27CKCgnQ4OLiyvz8O92b3Cne3eyzwvF5/7cw8s/N5ZvdZln3f\nM5NIpVIRAAAAAAAAEIaiQhcAAAAAAAAArDgCQgAAAAAAAAiIgBAAAAAAAAACIiAEAAAAAACA\ngAgIAQAAAAAAICACQgAAAAAAAAiIgBAAAAAAAAACIiAEAAAAAACAgAgIAQAAAAAAICACQgAA\nAAAAAAiIgBAAoMWLp26SyLT7H98vdFFB272mIv5y/Oaz2kJXtJK6cp2a+IkqdDmdtYqWvWI4\nOe1Zqc7MB3/cJV5MWdWYNps9uP2QeLP1DpvQRqNUw1rlxfFm+zw+pWerb1NqSbyGfuvdUIAa\nAACAnicgBABIazrrjveyVv373DsKUgo9bdH0O4bF7H7hq4WuqAcVqrNBnWTScnzdV623zdCv\nnxZfXFo7ccK8pa2b3fHO3Pji9AkPtW6