AAAAIBGBEAAAAAAAABIRCAEAAAAAACARgRAAAAAAAAASEQgBAAAA\nAAAgEYEQAAAAAAAAEhEIAQAAAAAAIBGBEAAAAAAAABIRCAEAAAAAACARgRAAAAAAAAASEQgB\nAAAAAAAgEYEQAAAAAAAAEhEIAQAAAAAAIBGBEAAAAAAAABIRCAEAAAAAACARgRAAAAAAAAAS\nEQgBAAAAAAAgEYEQAAAAAAAAEhEIAQAAAAAAIBGBEAAAAAAAABIRCAEAAAAAACARgRAAAAAA\nAAASEQgBAAAAAAAgEYEQBFAs5QAAAW1JREFUAAAAAAAAEhEIAQAAAAAAIBGBEAAAAAAAABIR\nCAEAAAAAACARgRAAAAAAAAASEQgBAAAAAAAgEYEQAAAAAAAAEhEIAQAAAAAAIBGBEAAAAAAA\nABIRCAEAAAAAACARgRAAAAAAAAASEQgBAAAAAAAgEYEQAAAAAAAAEhEIAQAAAAAAIBGBEAAA\nAAAAABIRCAEAAAAAACARgRAAAAAAAAASEQgBAAAAAAAgEYEQAAAAAAAAEhEIAQAAAAAAIBGB\nEAAAAAAAABIRCAEAAAAAACARgRAAAAAAAAASEQgBAAAAAAAgEYEQAAAAAAAAEhEIAQAAAAAA\nIBGBEAAAAAAAABIRCAEAAAAAACARgRAAAAAAAAASEQgBAAAAAAAgEYEQAAAAAAAAEhEIAQAA\nAAAAIBGBEAAAAAAAABIRCAEAAAAAACARgRAAAAAAAAASEQgBAAAAAAAgEYEQAAAAAAAAEhEI\nAQAAAAAAIJH/B4CvkvWWbA99AAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":720,"width":1200}},"output_type":"display_data"}],"source":["# Average Hourly Intensity throughout the Week\n","hourly_activity_merged %>%\n","  group_by(weekday, activity_hour_hms) %>%\n","  summarise(average_hourly_intensity = mean(total_intensity)) %>% \n","  ggplot(aes(x = activity_hour_hms, y = weekday, fill = average_hourly_intensity)) +\n","  theme(axis.text.x = element_text(angle=90)) +\n","  scale_fill_continuous(low=\"white\", high = \"#9F7175\") +\n","  geom_tile(colour = \"white\", lwd= .5, linetype = 1) + \n","  coord_fixed() + \n","  labs(x = \"Time of Day\", y =\"Weekday\", title =\"Average Hourly Intensity throughout the Week\", fill = \"Average Hourly Intensity\") +\n","  theme(plot.title = element_text(hjust = 0.5, vjust = 0.8, size = 20, face = 'bold'), panel.background = element_blank()) +\n","  theme(axis.text.x = element_text(angle = 90, , size = 14)) +\n","  theme(axis.title.x = element_text(size = 16),\n","        axis.title.y = element_text(size = 16),\n","        legend.title = element_text(size=20),\n","        legend.text = element_text(size=18))"]},{"cell_type":"markdown","id":"da184a39","metadata":{"papermill":{"duration":0.058315,"end_time":"2024-03-21T13:33:54.418989","exception":false,"start_time":"2024-03-21T13:33:54.360674","status":"completed"},"tags":[]},"source":["#### Key Findings\n","* Consistent with earlier observations, **intensity peaks from 17:00 to 19:00**, post-work hours. \n","* The midday **peak from 12:00 to 14:00** on weekdays (Monday - Friday) is less pronounced than the previous graph had shown. The peak during that period actually comes from **high activity and intensity levels on Saturday** when people have more time to workout or do other activities that require higher intensities. \n","* Users go to bed and wake up later during weekends.\n","<br>\n","<br>\n","\n","### 4.2.2 Device Usage Levels\n","Daily usage of the device will be examined to understand how users use the device and how often they use it.\n","\n","#### **Daily Device Usage Percentage**\n","To determine device usage frequency, participants will be categorized based on the number of days they used the device. The resulting percentages will be visualised using a pie chart."]},{"cell_type":"code","execution_count":47,"id":"ac4a4c7b","metadata":{"execution":{"iopub.execute_input":"2024-03-21T13:33:54.539056Z","iopub.status.busy":"2024-03-21T13:33:54.537273Z","iopub.status.idle":"2024-03-21T13:33:54.577213Z","shell.execute_reply":"2024-03-21T13:33:54.575369Z"},"papermill":{"duration":0.102351,"end_time":"2024-03-21T13:33:54.579537","exception":false,"start_time":"2024-03-21T13:33:54.477186","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 3 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>daily_usage_level</th><th scope=col>users_total</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>High Usage    </td><td>24</td></tr>\n","\t<tr><td>Low Usage     </td><td> 1</td></tr>\n","\t<tr><td>Moderate Usage</td><td> 8</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 3 × 2\n","\\begin{tabular}{ll}\n"," daily\\_usage\\_level & users\\_total\\\\\n"," <chr> & <int>\\\\\n","\\hline\n","\t High Usage     & 24\\\\\n","\t Low Usage      &  1\\\\\n","\t Moderate Usage &  8\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 3 × 2\n","\n","| daily_usage_level &lt;chr&gt; | users_total &lt;int&gt; |\n","|---|---|\n","| High Usage     | 24 |\n","| Low Usage      |  1 |\n","| Moderate Usage |  8 |\n","\n"],"text/plain":["  daily_usage_level users_total\n","1 High Usage        24         \n","2 Low Usage          1         \n","3 Moderate Usage     8         "]},"metadata":{},"output_type":"display_data"}],"source":["activity_usage <- daily_activity_merged %>% \n","  group_by(id) %>% \n","  summarize(days_used = sum(n())) %>% \n","  mutate(daily_usage_level = case_when(\n","    days_used >= 1 & days_used <= 10 ~ 'Low Usage',\n","    days_used > 10 & days_used <= 20 ~ 'Moderate Usage',\n","    days_used > 20 ~ 'High Usage'\n","  )) %>% \n","  drop_na() %>% \n","  group_by(daily_usage_level) %>% \n","  summarize(users_total = n())\n","\n","head(activity_usage)"]},{"cell_type":"code","execution_count":48,"id":"289cf8a7","metadata":{"execution":{"iopub.execute_input":"2024-03-21T13:33:54.700237Z","iopub.status.busy":"2024-03-21T13:33:54.698588Z","iopub.status.idle":"2024-03-21T13:33:54.97792Z","shell.execute_reply":"2024-03-21T13:33:54.976054Z"},"papermill":{"duration":0.34263,"end_time":"2024-03-21T13:33:54.980859","exception":false,"start_time":"2024-03-21T13:33:54.638229","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAYYCAIAAACSFmR8AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5gV1f0H4Ll7t8IuvQpiQxS72EDB3qLGEmMlxgKx/5KosffeW4jd2LtYUdRY\nERV7BQFBQOmdZXu79/cHuty9uwsr3C0y7/vkyXPnzJmZ784Mz+Pu555zIvF4PAAAAAAAAADC\nIa25CwAAAAAAAACajoAQAAAAAAAAQkRACAAAAAAAACEiIAQAAAAAAIAQERACAAAAAABAiAgI\nAQAAAAAAIEQEhAAAAAAAABAiAkIAAAAAAAAIEQEhAAAAAAAAhI