AAAAjghAAAAAAAABGBCEAAAAAAACMCEIAAAAAAAAY\nEYQAAAAAAAAwIggBAAAAAABgRBACAAAAAADAiCAEAAAAAACAEUEIAAAAAAAAI4IQAAAAAAAA\nRgQhAAAAAAAAjAhCAAAAAAAAGBGEAAAAAAAAMCIIAQAAAAAAYEQQAgAAAAAAwIggBAAAAAAA\ngBFBCAAAAAAAACOCEAAAAAAAAEYEIQAAAAAAAIwIQgAAAAAAABgRhAAAAAAAADAiCAEAAAAA\nAGBEEAIAAAAAAMCIIAQAAAAAAIARQQgAAAAAAAAjghAAAAAAAABGBCEAAAAAAACMCEIAAAAA\nAAAYEYQAAAAAAAAwIggBAAAAAABgRBACAAAAAADAiCAEAAAAAACAEUEIAAAAAAAAI4IQAAAA\nAAAARgQhAAAAAAAAjAhCAAAAAAAAGBGEAAAAAAAAMCIIAQAAAAAAYEQQAgAAAAAAwIggBAAA\nAAAAgBFBCAAAAAAAACOCEAAAAAAAAEYEIQAAAAAAAIwIQgAAAAAAABgRhAAAAAAAADAS1AYu\njGw9XAYAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":780,"width":1200}},"output_type":"display_data"}],"source":["# Percentage of the device being worn < 20 hours\n","slices_v3 <- c(403, 433)\n","labels_v3 <- c(\"Device worn < 20 hours\", \"Device worn > 20 hours\")\n","pct_v1 <- slices_v3/sum(slices_v3)*100\n","pct_v1 <- round(pct_v1, 2)\n","labels_v3 <- paste(labels_v3, pct_v1)\n","labels_v3 <- paste(labels_v3, \"%\", sep = \"\")\n","colours <- c(\"#996855\", \"#cebdbf\")\n","options(repr.plot.width = 20, repr.plot.height = 13)\n","pie(slices_v3, labels = labels_v3,\n","    main = \"Percentage of the Device Being Worn \\nLess than 20 Hours per Day\", col = colours, border = \"white\", radius = 1,\n","   cex.main = 2, cex = 1.5)"]},{"cell_type":"markdown","id":"a9ef0455","metadata":{"papermill":{"duration":0.066149,"end_time":"2024-03-21T13:33:57.333638","exception":false,"start_time":"2024-03-21T13:33:57.267489","status":"completed"},"tags":[]},"source":["#### Key Findings\n","* A significant portion of participants did not wear the device for the entire day during the study.\n","* **48.21%** of participants **wore the device for less than 20 hours per day**. \n","<br>\n","<br>\n","\n","#### **Activity Device Usage vs Sleep Device Usage**\n","Given that almost half of the participants wore the device for less than 20 hours per day, it is plausible that these unaccounted hours correspond to sleep periods wh